import React, {useEffect, useState} from 'react';
import axios from 'axios';

export default ()=>{
    const [input, setInput] = useState('');
    const [data, setData] = useState([])
    useEffect(()=>{
        axios.get('https://randomuser.me/api/?results=200&nat=us').then(res=>setData(res.data.results))
    }, [])

    useEffect(()=>{
console.log(data)
    },[data])

    return(
        <>
        <input value={input} onChange={(e)=>setInput(e.target.value)}/>
        <h4>Employees</h4>
        <table>
        <thead>
          <tr>
              <th>Picture</th>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
          </tr>
        </thead>
        <tbody>
            {data.map(user=>
            <tr key={user.id.value}>
            <td><img src={user.picture.thumbnail}/></td>
            <td>{user.name.first} {user.name.last}</td>
            <td>{user.email}</td>
            <td>{user.phone}</td>
          </tr>
          )}
        </tbody>
      </table>
        </>
    )
}
